	add("melioidosis", "{\"term\":\"melioidosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An infectious disease caused by the bacterium , endemic to some areas of Southeast Asia and northern Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Mark A. Suckov, Alexander Valisenko, Nikolai Tokarevich, \u0027Chapter 3: Animals Models in in Biodefense Research\u0027, Jann Hau, Steven J. Schapiro, Gerald L. Van Hoosier, Jr. (editors), \u0027Handbook of Laboratory Animal Science\u0027, Volume 3: Animal Models, 2nd Edition, [https://books.google.com.au/books?id\u003dtZLMBQAAQBAJ\u0026amp;pg\u003dPA40\u0026amp;dq\u003d%22meliodosis%22%7C%22melioidoses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22meliodosis%22%7C%22melioidoses%22\u0026amp;f\u003dfalsepage 40\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A close relative of the agent of glanders, \u0027B. pseudomallei\u0027 causes a disease (\u0027\u0027melioidosis\u0027\u0027) with clinical manifestations including asymptomatic pneumonitis, acute or chronic pneumonia, and overwhelming septicemia\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0027\u0027\u0027Melioidosis\u0027\u0027: New Insights for the Healthcare Professional\u0027, [https://books.google.com.au/books?id\u003dP__0cAikI7oC\u0026amp;pg\u003dPA7\u0026amp;dq\u003d%22melioidosis%22%7C%22melioidoses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22melioidosis%22%7C%22melioidoses%22\u0026amp;f\u003dfalse page 7\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Twenty-seven proteins distinctively reacted with human plasma following environmental exposure or clinical \u0027\u0027melioidosis\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Prakash S. Bisen, Ruchika Raghuvanshi, \u0027Emerging Epidemics: Management and Control\u0027, [https://books.google.com.au/books?id\u003dFpoZGznXhTAC\u0026amp;pg\u003dPT531\u0026amp;dq\u003d%22melioidosis%22%7C%22melioidoses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22melioidosis%22%7C%22melioidoses%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Melioidosis\u0027\u0027 is the etiological designation of a spectrum of clinical manifestations caused by the gram-negative bacillus \u0027Burkholderia pseudomallei\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Jeremy Hull, Julian Forton, Anne Thomson, \u0027Paediatric Respiratory Medicine\u0027, 2nd Edition, [https://books.google.com.au/books?id\u003dnL26BwAAQBAJ\u0026amp;pg\u003dPA159\u0026amp;dq\u003d%22meliodosis%22%7C%22melioidoses%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22meliodosis%22%7C%22melioidoses%22\u0026amp;f\u003dfalse page 159\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Burkholderia pseudomallei\u0027 is the cause of \u0027\u0027meliodosis\u0027\u0027, which is a multiorgan infection seen mainly in South East Asia and Northern Australia. \u0027\u0027Meliodosis\u0027\u0027 often first presents with lung disease, which may be an acute pneumonia or more chronic lung disease, sometimes resembling TB\", \"priority\":13}]}, \"synonyms\":{}}");

	add("meliorism", "{\"term\":\"meliorism\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027melior\u0027 (better) {{suffix||ism|lang\u003den}}. Reportedly coined by British author w:George Eliot|George Eliot in her letters, published in 1877.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The view or doctrine that the world can be improved through human effort (often understood as an intermediate outlook between optimism and pessimism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027 May 6, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,901869,00.html Forever Beginning],\u0026quot; \u0027Time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At the convention, the official mood was traditional Methodist \u0027\u0027meliorism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, page 371\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Enclaves of meritocratic and virtuous sociability, the lodges exuded [...] a thoroughgoing \u0027\u0027meliorism\", \"priority\":5}]}, \"synonyms\":{}}");

	add("melisma", "{\"term\":\"melisma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μέλισμα\u0027 (song)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A passage of several notes sung to one syllable of text, as in Gregorian chant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Michael Chabon, \u0027Gentlemen of the Road\u0027, Sceptre 2008, p. 38\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At the top of the hill in the archway of the main house, an eyeless old man sat on a bucket, scratching at a two-stringed gourd, warbling weird \u0027\u0027melismas\u0027\u0027 on a madman\u0027s text\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Anthony Burgess, \u0027Kingdom of the Wicked\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A choir sang one of the Lamentations of Jeremiah. The mournful \u0027\u0027melisma\u0027\u0027 accompanied the slow procession to the palace built by Herod the Great, at present untenanted\", \"priority\":5}]}, \"synonyms\":{}}");

	add("melissa", "{\"term\":\"melissa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027melissa\u0027 from Ancient greek (to 1453) \u0027μέλισσα\u0027 (bee) (because the plant attracted bees).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant of the \u0027Melissa\u0027 genus, especially lemon balm, often used medicinally\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.4.1.iii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Melissa\u0027\u0027, Bawm, hath an admirable vertue to alter melancholy, be it steeped in our ordinary drink, extracted, or otherwise taken\", \"priority\":3}]}, \"synonyms\":{}}");

