	add("meltdown", "{\"term\":\"meltdown\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Severe overheating of the core of a nuclear reactor resulting in the core melting and radiation escaping\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Four years have passed since the \u0027\u0027meltdown\u0027\u0027 at the Chernobyl nuclear plant, but the grim legacy of the Soviet catastrophe is still unfolding.\u0027 [http://www.time.com/time/daily/chernobyl/chernobyl.index.html\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A situation being likened to a nuclear meltdown; a crisis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, James Wickham, \u0027Perv Spoof Bosses Axe Wrestling\u0027 (in \u0027The Daily Star\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Channel 4 switchboards went into \u0027\u0027meltdown\u0027\u0027 this week when viewers called to complain about a Brass Eye programme on child sex\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Computer engineers were at a loss last night to explain why the Government had been hit by arguably the worst electronic \u0027\u0027meltdown\u0027\u0027 in the history of Whitehall.\u0027 [http://news.independent.co.uk/uk/politics/story.jsp?story\u003d587262\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A tantrum\", \"priority\":7}]}, \"synonyms\":{}}");

