	add("melvin", "{\"term\":\"melvin\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Variant of the Scottish surname Melville, from a place name Malleville in Normandy, from Latin \u0027mala\u0027 (bad) + Old french (842-ca. 1400) \u0027ville\u0027 (settlement) * Used to Anglicize \u0027mac gille beathain\u0027 in Scotland and \u0027ó maoil mhín\u0027 in Ireland.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1824\u0027\u0027 w:Thomas Thomas M\u0027Crie, The Life of Andrew Melville, W. Blackwood (1824), page 416\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Melville always wrote his name \u0027Melvinus\u0027 in Latin, and he is often called \u0027\u0027\u0027Melvin\u0027\u0027\u0027 in English. Hence some have concluded that \u0027\u0027\u0027Melvin\u0027\u0027\u0027, and not \u0027Melville\u0027, was his proper name. But they are merely different modes of pronouncing the same family appellation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027 w:Melvin Melvin Belli, \u0027My Life on Trial: An Autobiography\u0027, Morrow, ISBN 0688030858, page 21\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And for some reason, they called me Pete. My mother, who probably dug up the name \u0027\u0027Melvin\u0027\u0027 from some romantic novel about Englishmen drinking tea, cringed at the \u0026quot;Pete\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

